                    { new Guid("095b3b14-a650-4da2-86f1-0a45266cd4fe"), "Colin Farrell, Brendan Gleeson, Kerry Condon, Barry Keoghan", "Velika Britanija, Irska ", "Crna komedija scenarista i redatelja filma „Tri plakata izvan grada” u kojoj su zvijezde Colin Farrell i Brendan Gleeson, nasmijat će vas, ali i rastužiti do suza.Smješten na udaljenom otoku u blizini zapadne obale Irske, film prati dugogodišnje prijatelje Pádraica (Colin Farrell) i Colma (Brendan Gleeson), koji se nađu u slijepoj ulici kada Colm neočekivano prekine njihovo prijateljstvo.", "Martin McDonagh ", 114, "komedija, drama", true, "DUHOVI OTOKA", "", 2023 },
                    { new Guid("1223e8af-1bc7-46a5-9869-3e7d8b81c944"), "Brendan Fraser, Sadie Sink, Hong Chau", "SAD", "Priča govori o povučenom učitelju engleskog, ozbiljno pretilom, koji se bori sa zdravstvenim problemima te se pokušava ponovno povezati sa svojom otuđenom sedamnaestogodišnjom kćeri. Nju i njezinu majku ostavio je prije mnogo godina, zbog veze s muškarcem.Na ovogodišnjem Venecijanskom filmskom festivalu film je dobio sve pohvale, kako kritike, tako i publike koja ga je nagradila višeminutnim ovacijama..", "Darren Aronofsky", 117, "drama", true, "KIT", "", 2022 },
                    { new Guid("18fedeb3-205a-4471-93d7-2aa2fae51798"), "Martin Freeman, Letitia Wright, Angela Bassett, Lupita Nyong’o, Danai Gurira", "SAD", "Pripremite se za povratak u Wakandu! Nastavak filma Black Panther iz 2018. godine koji je oduševio kritičare i publiku diljem svijeta. Uz to, film je osvojio i tri Oscara, za najbolju originalnu glazbu, najbolji dizajn kostima i najbolju scenografiju.Wakanda se mora zaštititi od svjetskih sila koje interveniraju nakon smrti kralja T’Challe. Dok Wakanđani nastoje prihvatiti gubitak voljenog vođe, heroji se moraju udružiti te uz pomoć Nakiae i Everetta Rossa iskovati novi plan za kraljevstvo Wakande.", "Ryan Coogler", 161, "akcija, avantura", true, "BLACK PANTHER: WAKANDA ZAUVIJEK", "", 2022 },
                    { new Guid("204ee6ef-2e65-4a4c-bf0d-a1068b5bb6eb"), "Zachary Levi, Helen Mirren, Lucy Liu", "SAD", "Svi imamo superjunake u sebi, potrebno je samo malo magije. U slučaju 14-godišnjeg dječaka Billyja Batsona potrebno je samo reći SHAZAM!Henry Gayden je i ovog puta napisao scenarij pun akcije i smijeha.Superheroj Shazam je cinični tinejdžer koji se trudi pronaći svoje mjesto u svijetu i ne zna ništa o takvim junacima, a kamoli kako biti jedan. U njegovomse životu sve vrti oko magične riječi koja ga transformira u njegov odrasli alter ego superheroja, Shazama.", "David F. Sandberg ", 130, "akcija, avantura", true, "SHAZAM! BIJES BOGOVA", "", 2022 },
                    { new Guid("3e57a215-bfbb-45e5-9b1a-f55f3ae9d95c"), "Tom Cruise, Miles Teller, Jennifer Connelly, Jon Hamm, Glen Powell", "SAD", " Nakon više od 30 godina služenja u mornarici, kao jedan od najboljih pilota, Pete “Maverick” Mitchell (Tom Cruise) je tamo gdje i treba da bude. Ne preza da probije barijere kao hrabar test pilot i izbjegava da prihvati unapređenje koje bi ga zauvijek spustilo na zemlju. Kada je počeo da podučava vod mladih pilota koji su na obuci za specijalne misije, kakve ni jedan živi pilot nikada još nije vidio, Maverick sreće poručnika Bradleya Bradshawa čiji je nadimak “Rooster”, sina Maverickovog pokojnog prijatelja i oficira za presretanje radara, poručnika Nicka Bradshawa, zvanog “Gus”.", "Joseph Kosinski ", 131, "akcija, avantura", true, "TOP GUN: MAVERICK", "", 2022 },
                    { new Guid("53452273-3b18-458e-8fba-e0f03d413854"), "Michelle Williams, Gabriel LaBelle, Paul Dano", "SAD", "Višestruko nagrađivani Steven Spielberg, jedan od najznačajnijih reditelja u povijesti kinematografije, nakon ekranizacija svih mogućih priča, od fantastičnih avantura do ozbiljnih ratnih filmova, napokon je snimio film o sebi.U novoj uzbudljivoj filmskoj priči Spielberg donosi intimni pogled u svoje djetinjstvo u polu-autobiografskom filmu koji prati osjetljive godine mladića koji će otkriti potresnu porodičnu tajnu što će ga potaknuti da uroni u svijet filmova koji će mu pomoći da spozna istinu o sebi i drugima.", "Steven Spielberg", 151, "drama", true, "FABELMANOVI", "", 2022 },
                    { new Guid("7e72a10a-df1c-4edf-985b-c00532d4db8d"), "Michael B. Jordan, Jonathan Majors, Tessa Thompson", "SAD", "Nakon uspjeha u svijetu boksa, Adonis Creed napreduje i u karijeri i u porodičnom životu. Kada se nakon odslužene zatvorske kazne pojavi njegov prijatelj iz djetinjstva, i nekadašnje boksačko čudo, Damian (Jonathan Majors) će zaželjeti priliku u ringu. Sučeljavanje bivših prijatelja više je od obične tučnjave. Kako bi poravnao račune, Adonis mora staviti svoju budućnost na kocku kako bi se borio protiv Damiana - borca koji nema što izgubiti.", "Michael B. Jordan", 116, "sportska drama", true, "CREED III", "", 2023 },
                    { new Guid("90890adf-d5a1-47be-a647-ff5f45e1119a"), "Keanu Reeves, Donnie Yen, Bill Skarsgard, Laurence Fishburne", "SAD", "U četvrtom nastavku velikog akcijskog spektakla John Wick se suočava sa dosad najsmrtonosnijim protivnicima.John Wick (Keanu Reeves) otkriva put do pobjede nad Visokim stolom. Ali prije nego što uspije zaslužiti slobodu, Wick se mora suočiti s novim neprijateljem i moćnim savezima diljem svijeta, te silama koje stare prijatelje pretvaraju u neprijatelje.Radnja novog filma odvija se diljem svijeta i donosi precizno-koreografiranu akciju posebne vrste. U potrazi za najmoćnijim igračima kriminalnog podzemnog svijeta, film vodi gledatelje u New York, Pariz, Osaku i Berlin.", "Chad Stahelski", 169, "akcija", true, "JOHN WICK 4", "", 2023 },
